import { Component } from '@angular/core';

@Component({
  selector: 'vts-demo-image-placeholder',
  template: `
    <vts-space [vtsSize]="12">
      <img *vtsSpaceItem vts-image width="400px" height="300px" [vtsSrc]="src" [vtsPlaceholder]="placeholder" />
      <button *vtsSpaceItem vts-button vtsType="primary" (click)="onReload()">Reload</button>
    </vts-space>
  `
})
export class VtsDemoImagePlaceholderComponent {
  src = `https://picsum.photos/4000/3000`;
  placeholder = 'data:image/gif;base64,'

  onReload(): void {
    this.src = `https://picsum.photos/4000/3000?${new Date()}`;
  }
}
